1. Add the following configuration to your docker-compose file:

version: '3'
services:
  proxy:
    image: nginx:latest
    ports:
      - "80:80"
    volumes:
      - ./nginx.conf:/etc/nginx/nginx.conf:ro
  frontend:
    build: .
    environment:
      - PROXY_URL=http://proxy:80
    ports:
      - "3000:3000"
  backend:
    build: .
    ports:
      - "8080:8080"

2. Create an `nginx.conf` file in the same directory as your docker-compose file and add the following configuration:

events {
